import React from "react";
import PropTypes from "prop-types";
import { withStyles } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Typography from "@material-ui/core/Typography";
import classNames from "classnames";
import Button from "@material-ui/core/Button";
import AddIcon from "@material-ui/icons/Add";
import EmailIcon from "@material-ui/icons/Email";
import FilterIcon from "@material-ui/icons/FilterList";
import Dialog from "@material-ui/core/Dialog";
import DialogActions from "@material-ui/core/DialogActions";
import DialogContent from "@material-ui/core/DialogContent";
import DialogTitle from "@material-ui/core/DialogTitle";
import FormControl from "@material-ui/core/FormControl";
import FormGroup from "@material-ui/core/FormGroup";
import FormControlLabel from "@material-ui/core/FormControlLabel";
import Checkbox from "@material-ui/core/Checkbox";
import VisibilityIcon from "@material-ui/icons/Visibility";
import TextField from "@material-ui/core/TextField";
import MenuItem from "@material-ui/core/MenuItem";

const styles = theme => ({
  root: {
    paddingTop: theme.spacing(2),
    paddingBottom: theme.spacing(2),
    marginTop: theme.spacing(5),
    marginLeft: theme.spacing(65),
    align: "center",
    width: "19.5%"
  },
  button: {
    margin: theme.spacing.unit
  },
  leftIcon: {
    marginRight: theme.spacing.unit
  },
  rightIcon: {
    marginLeft: theme.spacing.unit
  },
  iconSmall: {
    fontSize: 20
  },
  container: {
    display: "flex",
    flexWrap: "wrap"
  },
  textField: {
    marginLeft: theme.spacing(1),
    marginRight: theme.spacing(1),
    width: 300
  }
});

const titles = [
  {
    value: "",
    label: ""
  },

  {
    value: "Dr.",
    label: "Dr."
  },

  {
    value: "Miss",
    label: "Miss"
  },

  {
    value: "Mr.",
    label: "Mr."
  },
  {
    value: "Mrs.",
    label: "Mrs."
  },
  {
    value: "Ms.",
    label: "Ms."
  },
  {
    value: "Mx.",
    label: "Mx."
  }
];

class teamMemberActions extends React.Component {
  state = {
    open: false,
    openV: false,
    firstName: "Harry",
    lastName: "Potter",
    email: "harry@hogwarts.com",
    title: "Mr.",
    currentPassword: "test123",
    confirmPassword: "test123",
    phone: "123-456-1111",
    address: "713 Hogwarts Lane",
    primaryLocation: "Diagon Alley",
    npi: "731890",
    city: "London",
    zipCode: "77777",
    multiline: "Controlled"
  };

  /* change of team member dropdown */
  handleChange = name => event => {
    this.setState({ [name]: event.target.checked });
  };

  /* show assign client diaglog box */
  handleClickOpen = () => {
    this.setState({ open: true });
  };

  /* show assign client diaglog box */
  handleClickOpen2 = () => {
    this.setState({ openV: true });
  };

  /* close assign client diaglog box */
  handleClose = () => {
    this.setState({ open: false });
  };

  render() {
    const { classes } = this.props;
    const { name, email, phone, npi, role } = this.state;

    return (
      <div>
        <Paper className={classes.root} elevation={7}>
          <Button
            variant="contained"
            className={classes.button}
            onClick={this.handleClickOpen}
          >
            <AddIcon
              className={classNames(classes.leftIcon, classes.iconSmall)}
            />
            Add New
          </Button>
          {/*
          <Button
            variant="contained"
            className={classes.button}
            onClick={this.handleClickOpen}
          >

            <VisibilityIcon
              className={classNames(classes.leftIcon, classes.iconSmall)}
            />
            Show
          </Button>
            */}

          <Dialog open={this.state.open} onClose={this.handleClose}>
            <form className={classes.container} noValidate autoComplete="off">
              <DialogContent>
                <TextField
                  id="standard-select-title"
                  select
                  label="Title"
                  variant="outlined"
                  className={classes.textField}
                  value={this.state.title}
                  onChange={this.handleChange("title")}
                  SelectProps={{
                    MenuProps: {
                      className: classes.menu
                    }
                  }}
                >
                  {titles.map(option => (
                    <MenuItem key={option.value} value={option.value}>
                      {option.label}
                    </MenuItem>
                  ))}
                </TextField>

                <TextField
                  id="standard-phone"
                  variant="outlined"
                  label="Phone Number"
                  className={classes.textField}
                  value={this.state.phone}
                  onChange={this.handleChange("phone")}
                  margin="normal"
                />

                <TextField
                  required
                  id="standard-firstName"
                  label="First Name"
                  variant="outlined"
                  className={classes.textField}
                  value={this.state.firstName}
                  onChange={this.handleChange("firstName")}
                  margin="normal"
                />

                <TextField
                  required
                  id="standard-email"
                  variant="outlined"
                  label="Email"
                  className={classes.textField}
                  value={this.state.email}
                  onChange={this.handleChange("email")}
                  margin="normal"
                />

                <TextField
                  required
                  id="standard-lastNamename"
                  label="Last Name"
                  variant="outlined"
                  className={classes.textField}
                  value={this.state.lastName}
                  onChange={this.handleChange("lastName")}
                  margin="normal"
                />

                <TextField
                  id="standard-address"
                  variant="outlined"
                  label="Address"
                  className={classes.textField}
                  value={this.state.address}
                  onChange={this.handleChange("address")}
                  margin="normal"
                />

                <TextField
                  required
                  id="standard-password-input"
                  variant="outlined"
                  label="Password"
                  className={classes.textField}
                  type="password"
                  value={this.state.currentPassword}
                  //autoComplete="current-password"
                  margin="normal"
                />

                <TextField
                  id="standard-city-"
                  variant="outlined"
                  label="City"
                  className={classes.textField}
                  value={this.state.city}
                  onChange={this.handleChange("city")}
                  margin="normal"
                />

                <TextField
                  required
                  id="standard-confirmPassword-input"
                  variant="outlined"
                  label="Confirm Password"
                  className={classes.textField}
                  type="password"
                  value={this.state.confirmPassword}
                  //autoComplete="current-password"
                  margin="normal"
                />

                <TextField
                  id="standard-zipCode"
                  variant="outlined"
                  label="Zip Code"
                  className={classes.textField}
                  value={this.state.zipCode}
                  onChange={this.handleChange("zipCode")}
                  margin="normal"
                />

                <TextField
                  id="standard-npi"
                  variant="outlined"
                  label="NPI Number"
                  className={classes.textField}
                  value={this.state.npi}
                  onChange={this.handleChange("npi")}
                  margin="normal"
                />

                <TextField
                  id="standard-primary-location"
                  variant="outlined"
                  label="Primary Location"
                  className={classes.textField}
                  value={this.state.primaryLocation}
                  onChange={this.handleChange("primaryLocation")}
                  margin="normal"
                />
              </DialogContent>
              <DialogActions>
                <Button onClick={this.handleClose} color="primary">
                  Cancel
                </Button>
                <Button
                  onClick={() => {
                    this.onSubmit(
                      //this.state.title,
                      this.state.newBillType,
                      this.state.newClientType,
                      this.state.newClient,
                      this.state.thereapist,
                      this.state.newLocation,
                      this.state.newCategory,
                      this.state.selectedDate,
                      this.state.endSelectedDate
                    );
                    //this.reloadPage();
                  }}
                  color="primary"
                >
                  Save
                </Button>

                <Button onClick={this.reloadPage} color="primary">
                  Close
                </Button>
              </DialogActions>
            </form>
          </Dialog>

          {/* 'Show more' dialog box */}
          <Dialog open={this.state.openV} onClose={this.handleClose}>
            <DialogTitle id="form-dialog-title">Show</DialogTitle>
            <DialogContent>
              <FormControl component="fieldset" className={classes.formControl}>
                <FormGroup>
                  <FormControlLabel
                    control={
                      <Checkbox
                        checked={name}
                        onChange={this.handleChange("name")}
                        value="name"
                      />
                    }
                    label="Name"
                  />
                </FormGroup>
                <FormGroup>
                  <FormControlLabel
                    control={
                      <Checkbox
                        checked={email}
                        onChange={this.handleChange("email")}
                        value="email"
                      />
                    }
                    label="Email"
                  />
                </FormGroup>
                <FormGroup>
                  <FormControlLabel
                    control={
                      <Checkbox
                        checked={phone}
                        onChange={this.handleChange("phone")}
                        value="phone"
                      />
                    }
                    label="Phone"
                  />
                </FormGroup>
                <FormGroup>
                  <FormControlLabel
                    control={
                      <Checkbox
                        checked={npi}
                        onChange={this.handleChange("npi")}
                        value="npi"
                      />
                    }
                    label="NPI"
                  />
                </FormGroup>
                <FormGroup>
                  <FormControlLabel
                    control={
                      <Checkbox
                        checked={role}
                        onChange={this.handleChange("role")}
                        value="role"
                      />
                    }
                    label="Role"
                  />
                </FormGroup>
              </FormControl>
            </DialogContent>
          </Dialog>
        </Paper>
      </div>
    );
  }
}

teamMemberActions.propTypes = {
  classes: PropTypes.object.isRequired
};

export default withStyles(styles)(teamMemberActions);
